const results = [];

for (const item of $input.all()) {
  const vttContent = item.json.data;

  const cleanedLines = vttContent
    .split('\n')
    .map(line => line.trim())
    .filter(line => line !== 'WEBVTT')
    .filter(line => !/^\d+$/.test(line))
    .filter(line => !/^\d{2}:\d{2}:\d{2}\.\d{3} -->/.test(line))
    .filter(line => line !== '');

  let conversation = [];
  let currentSpeaker = null;
  let currentText = [];

  for (let line of cleanedLines) {
    const match = line.match(/^([^:]+):\s*(.*)$/);
    if (match) {
      const speaker = match[1].trim();
      const text = match[2].trim();

      if (speaker !== currentSpeaker && currentSpeaker !== null) {
        conversation.push(`${currentSpeaker}: ${currentText.join(' ')}\n`);
        currentText = [];
      }

      currentSpeaker = speaker;
      currentText.push(text);
    } else if (currentSpeaker) {
      currentText.push(line.trim());
    }
  }

  if (currentSpeaker && currentText.length > 0) {
    conversation.push(`${currentSpeaker}: ${currentText.join(' ')}\n`);
  }

  const result = conversation.join('');

  results.push({
    json: {
      output: result
    }
  });
}

return results;

